(49, '2023', '09-02-2023', '22_Dec_2023_12_15_34pm_कुश जयंती.jpg', 'कजलियां महोत्सव एवं कुश जयंती ', '<b>समरसता कजलियां महोत्सव की झलकियां</b><br><br>\r\nसमरसता सेवा संगठन के संयोजन में बंगाली क्लब जबलपुर में 31 अगस्त 2023 गुरुवार को\r\nसंस्कारधानी के सर्व समाज की सहभागिता से सम्पन्न<br>\r\nसमरसता कजलियां महोत्सव को झलकियां ,\r\nसभी सम्माननीय जनो ने अपनी गरिमामयी उपस्थिति एवम अपने प्रत्यक्ष और अप्रत्यक्ष सहयोग से महोत्सव को भव्यता प्रदान की सभी का आभार -----', 'DONE', 117, '22_Dec_2023_12_15_34pm_1.jpg', '22_Dec_2023_12_15_34pm_2.jpg', '22_Dec_2023_12_15_34pm_3.jpg', '22_Dec_2023_12_15_34pm_4.jpg', '22_Dec_2023_12_15_34pm_5.jpg', '', '', '', '', '', 'ywqd5aYki2Y'),
(50, '2023', '10-02-2023', '22_Dec_2023_12_18_59pm_वीर दुर्गादास राठौर जयंती.jpg', 'वीर दुर्गादास राठौर जयंती', 'समरसता सेवा संगठन द्वारा वीर दुर्गादास राठौर की जयंती पर विचार गोष्टी सम्पन्न ..<br><br>\r\n\r\nसब सबको जाने और सब सबको माने के उद्देश्य को लेकर समरसता सेवा संगठन ने वीर दुर्गादास राठौर की जयंती के अवसर पर रानी दुर्गावती कला वीथिका सभागार में विचार गोष्ठी एवँ सम्मान समारोह का आयोजन किया गया। <br><br>\r\nकार्यक्रम के मुख्य अतिथि वरिष्ठ पत्रकार श्री मोहन शशि, मुख्य वक्ता प्रो. डॉ आंनद सिंह राणा, विशिष्ट अतिथि गुरु रविदास महापीठ के अध्यक्ष श्री दास प्रसाद अहिरवार एवँ समरसता सेवा संगठन के अध्यक्ष श्री संदीप जैन , सहित विभिन्न जाति समाजो के बड़ी संख्या में उपस्थित बंधुओ एवं मातृ  शक्ति की गरिमामय उपस्थिति में वीर दुर्गादास राठौर जी की जयंती कार्यक्रम सम्पन्न हुआ। ', 'DONE', 117, '22_Dec_2023_12_18_59pm_11.jpg', '22_Dec_2023_12_18_59pm_12.jpg', '22_Dec_2023_12_18_59pm_13.jpg', '22_Dec_2023_12_18_59pm_14.jpg', '22_Dec_2023_12_18_59pm_15.jpg', '', '', '', '', '', 'QkVfzPnl3aA'),
(51, '2023', '11-02-2023', '22_Dec_2023_12_21_41pm_रानी अवंती बाई लोधी जयंती.jpg', 'रानी अवंती बाई लोधी जयंती', 'समरस भारत - समर्थ भारत के लिए <br>\r\nसामाजिक समरसता के परिपेक्ष्य में सब सबको जाने - सब सबको माने के उद्देश्य को लेकर सतत कार्य कर रही संस्था \" समरसता सेवा संगठन द्वारा \" वीरांगना रानी अवंतिबाई लोधी की जन्म जयंती पर विचार गोष्ठी एवँ सम्मान समारोह का आयोजन मुख्य अतिथि डॉ पं हरिशंकर दुबे, मुख्य वक्ता डॉ नूपुर देशकर, विशिष्ट अतिथि श्री राजेन्द्र सिंह, संगठन के अध्यक्ष श्री संदीप जैन गुड्डा,की गरिमामयी  उपस्थिति में टिम्बर भवन महानददा में सम्पन्न हुआ ।', 'DONE', 117, '22_Dec_2023_12_21_41pm_11.jpg', '22_Dec_2023_12_21_41pm_12.jpg', '22_Dec_2023_12_21_41pm_13.jpg', '22_Dec_2023_12_21_41pm_14.jpg', '22_Dec_2023_12_21_41pm_15.jpg', '', '', '', '', '', '87fV8_ko8CI'),
