(54, '2023', '14-02-2023', '22_Dec_2023_12_31_54pm_विश्वकर्मा जयंती.jpg', 'विश्वकर्मा जयंती', '.समरसता सेवा संगठन द्वारा विचार गोष्ठी एवं सम्मान समारोह का आयोजन मुख्य अतिथि पूर्व न्यायमूर्ति श्री एचपी सिंह जी , मुख्य वक्ता प्रो आशीष मिश्रा जी ,विशिष्ट अतिथि नामदेव समाज के प्रदेश अध्यक्ष श्री अशोक नामदेव जी ,विश्वकर्मा समाज के वरिष्ठ इंजीनियर एन विश्वकर्मा जी ,समरसता सेवा संगठन के अध्यक्ष संदीप जैन जी  सचिव उज्ज्वल पचौरी जी मंच संचालन कर्ता धीरज अग्रवाल जी के साथ समाज के गणमान्य जनो की उपस्थिति में प्रज्ञा मंडमप यादव कॉलोनी में किया गया ! इस अवसर पर आयोजित सम्मान समारोह में विश्वकर्मा समाज के समाजसेवी को सम्मानित किया गया। ', 'DONE', 117, '22_Dec_2023_12_31_54pm_1.jpg', '22_Dec_2023_12_31_54pm_2.jpg', '22_Dec_2023_12_31_54pm_3.jpg', '22_Dec_2023_12_31_54pm_4.jpg', '22_Dec_2023_12_31_54pm_55.jpg', '', '', '', '', '', 'HWRrhOddMYg'),
(55, '2023', '14-02-2023', '22_Dec_2023_12_35_12pm_रानी दुर्गावती जयंती.jpg', 'रानी दुर्गावती जयंती', 'वीरांगना रानी दुर्गावती की 500 वीं जयंती की पूर्व संध्या पर समरसता सेवा संगठन जबलपुर द्वारा विचार गोष्ठी, सम्मान समारोह एवँ रानी दुर्गावती के जीवन पर आधारित नाट्य मंचन का आयोजन मुख्य अतिथि  प्रो. खेमसिंह डेहरिया (कुलपति अटल बिहारी हिंदी विश्वविद्यालय), मुख्य वक्ता प्राचार्य श्रीमती रुकमणी कनोजिया, विशिष्ट अतिथि श्री अर्जुन सिंह मरकाम (सचिव, वनवासी विकास परिषद महाकोशल प्रांत), श्री रवि गुप्ता (अध्यक्ष, महाकौशल चेम्बर ऑफ कॉमर्स), समरसता सेवा संगठन के अध्यक्ष श्री संदीप जैन की उपस्थिति में शहीद स्मारक प्रेक्षागृह गोलबाजार में  आयोजित किया गया।<br><br>\r\nकार्यक्रम के दौरान संस्कारधानी के प्रख्यात गायक श्री रवि शुक्ला ने श्री उदयभानु तिवारी जी द्वारा लिखित वीरांगना रानी दुर्गावती के जीवन पर आधरित गीत को अपने स्वर प्रदान कर सुंदर प्रस्तुति दी।<br><br>\r\n साथ ही रानी दुर्गावती के जीवन पर आधरित नाट्य का मंचन नाट्य लोक संस्था के दबिन्दर सिंह एवँ साथियों द्वारा  किया गया।<br><br>\r\nकार्यक्रम के दौरान बनवासी बंधुओ के बीच सामाजिक सेवा कार्य कर रहे सुश्री दमयंती ठाकुर, गोविंद सिंह मरावी, डॉ के एल धुर्वे, एस आर कुमरे, सुंदर सिंह ठाकुर, राजा सिंह ठाकुर  का सम्मान किया गया।<br><br>\r\nकार्यक्रम का संचालन धीरज अग्रवाल एवँ आभार संगठन के सचिव  उज्ज्वल पचौरी ने किया।', 'DONE', 117, '22_Dec_2023_12_35_12pm_11.jpg', '22_Dec_2023_12_35_12pm_12.jpg', '22_Dec_2023_12_35_12pm_13.jpg', '22_Dec_2023_12_35_12pm_14.jpg', '22_Dec_2023_12_35_12pm_15.jpg', '', '', '', '', '', 'RImc5YdP8Ao'),
(56, '2023', '16-02-2023', '22_Dec_2023_12_38_32pm_महाराजा अग्रसेन जयंती.jpg', 'महाराजा अग्रसेन जयंती', 'अग्रकुल भूषण अग्रसेन जी महाराज की जयंती की पूर्व संध्या पर विचार गोष्ठी एवं सम्मान समारोह का आयोजन प्रोफेसर कौशल दुबे जी के मुख्याथित्य में सम्पन्न हुआ , कार्यक्रम में मुख्यवक्ता डॉ. पवन स्थापक, संगठन वक्ता श्री अखिल मिश्रा , अग्रवाल सभा के अध्यक्ष श्री यतीश अग्रवाल ने अपने विचार व्यक्त किए , इस अवसर पर समाज के प्रमुख जनो का सम्मान भी किया गया ....', 'DONE', 117, '22_Dec_2023_12_38_32pm_1.jpg', '22_Dec_2023_12_38_32pm_2.jpg', '22_Dec_2023_12_38_32pm_3.jpg', '22_Dec_2023_12_38_32pm_4.jpg', '22_Dec_2023_12_38_32pm_5.jpg', '', '', '', '', '', 'wR9KIlni81E'),
(58, '2023', '17-02-2023', '24_Dec_2023_10_53_40am_महर्षि वाल्मीकि जयंती.jpg', 'महर्षि बाल्मीकि जयंती एवं महाराजा अजमीढ़ जयंती', 'जबलपुर! सब सबको जाने - सब सबको माने के वाक्य को लेकर समरसता सेवा संगठन द्वारा आदिकवि महर्षि वाल्मीकि एवँ महाराजा अजमीढ़ जी की जयंती पर विचार गोष्ठी एवँ सम्मान समारोह का आयोजन मुख्यअतिथि पेंशनर एसोसिएशन के उप प्रान्त अध्यक्ष श्री श्रीकान्त पांडे, मुख्य वक्ता श्रीराम इंजीनियरिंग कॉलेज के प्रोफेसर डॉ अतुल दुबे विशिष्ठ अतिथि समाजसेवी श्री गोविंद अग्रवाल, समरसता सेवा संगठन के अध्यक्ष श्री संदीप जैन की उपस्थिति में महेश भवन गोपाल बाग में किया गया।', 'DONE', 117, '24_Dec_2023_10_53_40am_1.jpg', '24_Dec_2023_10_53_40am_2.jpg', '24_Dec_2023_10_53_40am_3.jpg', '24_Dec_2023_10_53_40am_4.jpg', '24_Dec_2023_10_53_40am_5.jpg', '', '', '', '', '', 'MpEZN8TVkGA'),
